import { width } from "@material-ui/system";

export const styles = theme => ({
  "@global": {
    body: {
      margin: 0
    },
    "#__next": {
      // background: "yellow"
    }
  },
  container: {
    // background: "green",
    display: "flex",
    maxWidth: 1280,
    margin: "auto"
  },
  featureItems: {
    display: 'flex',
    alignItems: 'center',
    "& > div": {
      display: 'flex',
      maxWidth: 329,
      alignItems: 'center',
    }  
  }

})
